const coffeeData = {
    name: "Ethiopian Yirgacheffe",
    description: "A premium single-origin coffee from the Yirgacheffe region of Ethiopia, known for its bright acidity and floral notes.",
    recipe: {
        grind: "Medium-fine",
        water: "200ml",
        temperature: "92-96°C",
        brewTime: "3-4 minutes",
        ratio: "1:16 (coffee to water)"
    },
    tastingNotes: [
        "Floral",
        "Citrus",
        "Berry",
        "Chocolate"
    ],
    origin: "Yirgacheffe, Ethiopia",
    elevation: "1,700-2,200m",
    process: "Washed",
    image: "https://images.unsplash.com/photo-1447933601403-0c6688de566e?w=800"
};

export default coffeeData;
